import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import './App.css';
import Footer from './Footer';
import Loader from './Loader';
import Main from './Main';
import Navigation from './Navigation';
import {faCircleArrowUp } from '@fortawesome/free-solid-svg-icons';


function App() {
  myFunction();


  return (
    <div className="App darkmode" >
      <div class="custom-shape-divider-bottom-1684461056">
    <svg data-name="Layer 1" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 1200 120" preserveAspectRatio="none">
    <path xmlns="http://www.w3.org/2000/svg" d="M 0 11 L 0 1 C 3 9 3 0 8 3 C 15 9 14 -1 17 1 C 19 3 20 1 22 1 C 23 1 24 2 24 2 C 25 4 26 3 27 3 L 27 3 L 27 11" fill="#121212"/>
    </svg>
</div>
      <Loader/>
      <Navigation/>
      <a href="home" className="back-to-top-btn btn btn-primary" title="Back to top"><FontAwesomeIcon icon={ faCircleArrowUp} /></a>
      <Main/>
      <Footer/>
    </div>
  );
}

function myFunction() {
  setTimeout(showPage, 1000);
}

function showPage() {
  document.querySelector(".loading-screen").style.display = "none";
}




export default App;
